  \"2016-03-16T06:31:30.608573\",\n\t\"name\": \"chincoteague-bay-surface-sediment-physical-parameters-data-from-the-spring-and-fall-sampli-2014\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Scientists from the U.S. Geological Survey,
  St. Petersburg Coastal and Marine Science Center conducted a seasonal collection
  of surficial sediments from Chincoteague Bay and Tom's Cove, located between Assateague
  Island and the Delmarva Peninsula in March/April 2014 (2014-301-FA) and October
  2014 (2014-322-FA). The sampling efforts were part of a larger U.S. Geological Survey
  study to assess the effects of storm events on sediment distribution. The objective
  of this study was to characterize the sediments of Chincoteague Bay in order to
  create baseline conditions to incorporate with hydrodynamic and sediment transport
  models in order to evaluate pre- and post-storm (Hurricane Sandy) change. This report
  serves as an archive for sedimentological data derived from the surface sediment.
  Data are available for a seasonal comparison between March/April 2014 and October
  2014. Downloadable data are available as Excel spreadsheets (sediment samples) and
  as JPEG files (maps). Additional files include: detailed results of sediment grain
  size analyses, and formal Federal Geographic Data Committee metadata (data downloads).\",\n\t\"license_title\":
